import{_ as l,o as i,c as t,Q as s}from"./chunks/framework.1b72a0e7.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"q/index.md","lastUpdated":null}'),o={name:"q/index.md"},e=s('<h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">1-安装Webview2异常终止</p><ul><li>此问题大概率是 Windows 系统权限的问题，先尝删除异常文件</li><li>参考文献：<a href="https://zhuanlan.zhihu.com/p/588463531" target="_blank" rel="noreferrer">https://zhuanlan.zhihu.com/p/588463531</a></li><li>使用方法：强行删除C:\\Program Files (x86)\\Microsoft 该文件夹，如果删除不掉请进入PE删除</li></ul></div><div class="tip custom-block"><p class="custom-block-title">2程序无法启动</p><ul><li>这种问题就是你的系统权限没有给予程序，检查电脑给予软件的权限</li><li>如系统弹窗，电脑管家弹窗都要点击允许！！ <code>交流QQ群：621320122</code></li></ul></div><div class="tip custom-block"><p class="custom-block-title">3无法登陆APP或者一直加载</p><ul><li>访问地址：<a href="https://login.applehub.cn/%E6%A3%80%E6%9F%A5%E7%94%B5%E8%84%91%E6%98%AF%E5%90%A6%E5%8F%AF%E4%BB%A5%E8%AE%BF%E9%97%AE%EF%BC%8C%E5%A6%82%E6%9E%9C%E4%B8%8D%E8%83%BD%E8%AE%BF%E9%97%AE%E4%BB%A3%E8%A1%A8%E5%B7%A5%E5%85%B7%E7%9A%84%E7%99%BB%E9%99%86%E6%9C%8D%E5%8A%A1%E5%99%A8%E8%A2%AB%E5%B1%8F%E8%94%BD%E4%BA%86%EF%BC%81" target="_blank" rel="noreferrer">https://login.applehub.cn/检查电脑是否可以访问，如果不能访问代表工具的登陆服务器被屏蔽了！</a></li><li>关闭代理或者换回原有网络</li></ul></div><div class="tip custom-block"><p class="custom-block-title">4进房间或者延迟为1000ms</p><ul><li>ERROR: authentication error, MAC or IP address already in use or not released yet by supernode</li><li>检查电脑网络防火墙有没有拦截网络，以及本地有没有使用其他网络软件或者代理</li><li>使用加速器时，不可以再使用其他网络软件，如加速器VPN代理等网络软件</li></ul></div><div class="tip custom-block"><p class="custom-block-title">5-还有工具后延迟显示异常但是可以联机</p><ul><li>可能是延迟波动比较大或者延迟显示BUG</li><li>只要可以联机无视即可！！</li></ul></div><div class="tip custom-block"><p class="custom-block-title">6-正常，但容易中断</p><p>Windows 下的 ze 数据传输（直连或中转）均通过 UDP 传输，在部分情况下，运营商会对 UDP 数据进行一定的限制，如：校园网，特殊地缘区域 解决办法：</p><ul><li><ol><li>点击工具右上角设置开启增强连接或者房间列表右上角</li></ol></li><li><ol start="2"><li>使用增强连接功能，提高稳定性但延迟会大大提高！！</li></ol></li><li><ol start="3"><li>非特殊情况不要开启该功能！！！</li></ol></li></ul></div><div class="tip custom-block"><p class="custom-block-title">7-工具正常，延迟正常，但找不到房间（或找得到房间，但无法加入）</p><p>虽然看似成功了，但是真实的联机原理还是不一样的，目前还存在相当一部分游戏是不支持的，肯需要游戏联机补丁或者服务端支持 也可查看顶部游戏与教材，查看联机方式，再不济请加入官群回复方便我们测试！</p></div>',8),a=[e];function c(r,p,n,d,u,E){return i(),t("div",null,a)}const A=l(o,[["render",c]]);export{m as __pageData,A as default};
